			this.scrolledwindow1.Add (w1);
			this.alignment1.Add (this.scrolledwindow1);
			this.Add (this.alignment1);
			if ((this.Child != null)) {
				this.Child.ShowAll ();
			}
			this.Hide ();
		}
	}
